import React from 'react';


class SubComponent extends React.Component{
    constructor(props){
        super(props)
        this.state = {
            family:{
                name:"Pinky",
                age: 20,
                qualification: "10 + 2"
            }
        }
    }
    render(){
        return(
            <div>
                <p>Name: {this.state.name}</p>
                <p>Age: {this.state.age}</p>
                <p>Qualification: {this.state.qualification}</p>
            </div>
        )
    }
}

export default SubComponent
